class BillingData {  BillingData({      this.firstName,       this.lastName,       this.street,       this.building,       this.floor,       this.apartment,       this.city,       this.state,       this.country,       this.email,       this.phoneNumber,});  BillingData.fromJson(dynamic json) {    firstName = json['first_name'];    lastName = json['last_name'];    street = json['street'];    building = json['building'];    floor = json['floor'];    apartment = json['apartment'];    city = json['city'];    state = json['state'];    country = json['country'];    email = json['email'];    phoneNumber = json['phone_number'];  }  String ?firstName;  String ?lastName;  String ?street;  String ?building;  String ?floor;  String ?apartment;  String ?city;  String ?state;  String ?country;  String ?email;  String? phoneNumber;  Map<String, dynamic> toJson() {    final map = <String, dynamic>{};    map['first_name'] = firstName;    map['last_name'] = lastName;    map['street'] = street;    map['building'] = building;    map['floor'] = floor;    map['apartment'] = apartment;    map['city'] = city;    map['state'] = state;    map['country'] = country;    map['email'] = email;    map['phone_number'] = phoneNumber;    return map;  }}